window.bookSummaryJSON = "<p>Only the truth will set us free…<br> <br> Our enemy almost trapped us. We were lucky to get away, and now it’s our turn to lay a trap for them.<br> <br> The truth about the graynites isn't the story we were told. And now, if we’re to survive, we must weave a story of our own.<br> <br> Lies and subterfuge will be our weapons, so ensuring we have the right allies is paramount. Only a select few can be trusted with the truth.<br> <br> The road ahead is shrouded with uncertainty. The only thing we can be sure of is the present, and I’m determined to spend that time with my mate. But how can I bask in joy when my happiness breaks another goyle’s heart?<br> <br> As we scramble to put the pieces of the puzzle together and form a clear picture of the true face of our enemy, time is running out.<br> <br> If they strike before we’re ready, then we’re all doomed.<br> <br> God, I hope we’re not all doomed…</p>"; 
